x=new A.jH(new R.bJ([new R.aq("MaterialButtonComponent","material-button","angular_components/lib/material_button/material_button.dart",'<p>A flat or raised button with an optional ripple effect.</p>\n<pre><code class="language-html">&lt;!-- A button with both icon and text --&gt;\n&lt;material-button (trigger)="generateNames()"&gt;\n    &lt;material-icon icon="lightbulb_outline"&gt;&lt;/material-icon&gt;\n    Get new ideas\n&lt;/material-button&gt;\n</code></pre>\n<h2>Attributes</h2>\n<p>The following attributes are commonly used with <code>&lt;material-button&gt;</code>:</p><ul><li><code>disabled</code>: If present, sets the [disabled] property to true. If the\n<code>disabled</code> property is true, this attribute is present.</li><li><code>raised</code>:  If present, sets the [raised] property to true. If the\n<code>raised</code> property is true, this attribute is present.</li><li><code>icon</code>: If present, removes the minimum width style of the button.\nTo specify the actual icon in the button, use a <code>&lt;glyph&gt;</code>,\n<code>&lt;material-icon&gt;</code>, or <code>&lt;img&gt;</code>.</li><li><code>no-ink</code>: If present, removes the ripple effect from the button.</li><li><code>clear-size</code>: If present, removes both <code>min-width</code> and <code>margin</code> from\nthe button.</li><li><code>dense</code>: If present, reduces <code>font-size</code> to 13px and button height to\n32px.</li></ul>\n<h2>Properties</h2>\n<p>The following MaterialButtonComponent properties are frequently used:</p><ul><li>[disabled]: True if the button should not respond to events, and\nshould have a style that suggests that interaction is not allowed.</li><li>[raised]: True if the button should have a box shadow that makes the\nbutton look raised.</li></ul>\n<h2>Events</h2>\n<p>To react to button clicks, handle the trigger event:</p><ul><li>[trigger]: Fired when the button is activated via click, tap, or\nkey press.</li></ul>\n<h2>Styling</h2>\n<p>Style the button with CSS as you would a normal DOM element:</p>\n<pre><code>/* Make #myButton green with yellow text */\n#myButton {\n  background: green;\n  color: yellow;\n}\n</code></pre>\n<p>By default the ripple is the same color as the foreground at 25% opacity.\nTo customize the color, use the <code>material-ripple</code> selector:</p>\n<pre><code>/* Make #myButton use a blue ripple instead of foreground color */\n#myButton material-ripple {\n  color: blue;\n}\n</code></pre>\n<p>The opacity of the ripple is not customizable via CSS.</p>\n<h2>See also</h2>\n<p>Examples:</p><ul><li><a href="https://github.com/dart-lang/angular_components_example/tree/master/lib/src/material_button_demo">material_button_demo example</a></li><li><a href="https://github.com/dart-lang/angular_components_example/blob/master/lib/src/demo_app/demo_app.html">demo_app/demo_app.html</a></li><li><a href="https://github.com/dart-lang/io_2017_components_codelab/tree/master">dart-lang/io_2017_components_codelab repo</a></li></ul>\n<p>Other resources:</p><ul><li><a href="https://codelabs.developers.google.com/codelabs/your-first-angulardart-web-app/">Material design codelab</a></li></ul>\n'),new R.aq("MaterialFabComponent","material-fab","angular_components/lib/material_button/material_fab.dart",'<p>Material FAB is a Floating Action Button. It is round, and behaves mostly\nthe same as a MaterialButton.</p>\n<p>It may be flat or raised. A raised button is styled with a shadow.</p>\n<p><strong>Example usage:</strong>\n    &lt;!-- A Floating Action Button (FAB). -->\n    <material-fab aria-label="add">\n      <material-icon icon="add"></material-icon>\n    </material-fab></p>\n<p><strong>Properties:</strong></p><ul><li><code>disabled: bool</code> -- Whether the button should not respond to events, and\nhave a style that suggests that interaction is not allowed.</li><li><code>raised: bool</code> -- Whether to have a box-shadow that makes the button look\nraised.</li></ul>\n<p><strong>Events:</strong></p><ul><li><code>trigger: Event</code> -- Published when the button is activated via click or\nkeypress.</li></ul>\n<p><strong>Styling:</strong></p>\n<p>Style the button with CSS as you would a normal DOM element.\n    /<em> Make #myButton green with yellow text </em>/\n    #myButton {\n      background: green;\n      color: yellow;\n    }</p>\n<p>By default the ripple is the same color as the foreground at 25% opacity.\nYou may customize the color using this selector:\n    /<em> Make #myButton use a blue ripple instead of foreground color </em>/\n    #myButton material-ripple {\n      color: blue;\n    }</p>\n<p>The opacity of the ripple is not customizable via CSS.</p>\n')],[new R.am(C.cJ,"MaterialButtonExample","material_button_example/lib/material_button_example.dart")],[],[],[],P.c()))
